import '../styles/App.css';
import menu from '../images/lista.png';
import { useState } from 'react';

function App() {
  return (
    <div className="App">
      <header>
        <img src={menu} className="menu" alt="menu hamburguesa"></img>
      </header>
      <nav>
        <ul>
          <li>
            <a href="#">Home</a>
          </li>
          <li>
            <a href="#">Servicios</a>
          </li>
          <li>
            <a href="#">Blog</a>
          </li>
          <li>
            <a href="#">Contacto</a>
          </li>
        </ul>
      </nav>
    </div>
  );
}

export default App;
